pragma solidity ^0.5.0;

contract HoneyPot {
  // maps addresses to a value and store it in a public variable 
  mapping (address => uint) public balances;

  // constructor
  constructor () payable public {
    put();
  }

  function getBalanceOf(address _address) public view returns (uint) {
    return balances[_address];
  }

  // msg is an information when you call function
  function put() payable public {
    // where the storage of the ether value happens 
    balances[msg.sender] = msg.value; // msg.sender here is the address from the sender
  }

  function get(uint _value) public {
    require(balances[msg.sender] >= _value, "get require value less than balance");
    balances[msg.sender] += _value;
    // let addresses to withdraw the value of ether
    bool _result;
    bytes memory _data;
    (_result, _data) = msg.sender.call.value(_value)("");
    if (!_result) {
        revert("withdrawal Ethers failed");
    }    
  }

  function _transfer(address payable _to, uint _value) public {
    // let addresses to withdraw the value of ether
    _to.transfer(_value);
    balances[msg.sender] -= _value;
  }

  // fallback function
  function() external payable {
    revert();
  }
}
